window.bookSummaryJSON = "<p>They have been branded as mountain bandits, but they are the descendants of the ancient attendants of the priestess. Long buried secrets lie in this remote land. Phoebe will uncover the devastating truth as she comes into her powers. She's ready to fight, but is she ready to bear the hopes and dreams of the entire realm on her shoulders? And will she be able to perform the Grand Quintet when one of her guardians is the enemy of the rest? </p> <p><i>Priestess Unleashed</i> is the thrilling conclusion to the steamy reverse harem fantasy trilogy. </p> <p>Contains mature themes.</p>"; 
